import React from 'react';
import Card from './Card';

function Tours({ tours, removeTours }) {
    return (
        <div className="container">
            <div>
                {/* heading */}
                <h2 className="title">Plan for Advanture</h2>
            </div>
            <div className="cards">
                {
                    tours.map(() => {
                        return (
                            <Card {...tours} removeTours={removeTours}></Card>
                        )
                    })
                }
            </div>
        </div>
    );
}

export default Tours;
